import hero2 from "../images/image_hero-removebg-preview.png";
import hero_primary from "../images/primary_hero.png";
import hero_alt from "../images/alt_hero.png"

function Header() {


    return (
        <div className="col-12">

            <div id="header" className="mx-auto">
                <img className="bordered img-fluid col-9" src={hero_primary} alt="Image of Jonathan Pruitt"/>    
                <div className="col-12 text-center">
                    <h1 className="">Jonathan Pruitt</h1>
                </div>        
            </div>
        </div>
    )
}//end method

export default Header;
